import "./fields.css";

function Fields() {
  return (
    <div className="fields">
        <input type="text" id="interests" name="interests" placeholder="Interests"></input>
        <input type="text" id="email" name="email" placeholder="Email"></input>
    </div>
  );
}

export default Fields;
